window.bookSummaryJSON = "<p>As he looked at life...</p> <p>...surrounded by the trappings of success...</p> <p>Austin wondered, is there anything else? </p> <p>He made it to the top. As CEO of an asteroid mining company, Austin has accomplished everything he ever wanted in business. Now, he needs more. To get away he turns to a fantasy video game. </p> <p>Is virtual reality the answer? </p> <p>Should he pick, elf, gnome, caster, or swordsman? </p> <p>He just wants peace and quiet, play as a dwarf, build a house, do some smithing and character building. His idea of the perfect fantasy game. Then he learns their secret. </p> <p>Deceit hides in the shadows. </p> <p>And the truth is all around. </p> <p>Austin will need to level up. </p> <p>If he gets caught, it means death. He’ll need help along the way. How can he convince anyone they’re slaves in a bigger game and stay under the radar? If Earth was a simulation and the game was real...</p> <p>Who can he trust? </p> <p>You’ll get hooked on this first book (of 11) in the Emerilia LitRPG series, because the characters grow and advance in the most believable of ways and the plot twists are fantastic. Any sufficiently advanced virtual reality makes it indistinguishable from reality.</p> <p>Get it now. </p>"; 
